import React, { useEffect, useState } from "react";

const Jodoh = () => {
  const [gas, setgas] = useState(false);
  const [kata, setkata] = useState("-");
  useEffect(() => {
    setgas(fale);
    if (gas) {
      setkata("zakie");
    } else {
      setkata("fajri");
    }
  });

  return (
    <div>
      <h1>{kata}</h1>
    </div>
  );
};

export default Jodoh;
